let padZero l1 l2 = 
  if List.length l1 = List.length l2
  then (l1, l2)
  else if (List.length l1) > (List.length l2)
  then let y = clone 0 (List.length l1 - List.length l2) @ l2 in
      (l1, y)
  else let z = clone 0 (List.length l2 - List.length l1) @ l1 in
      (z,l2)


